import './House.css';
const houses = [
    {
      name: "house1",
      description: "house 1 desc",
    },
    {
      name: "house2",
      description: "house 2 desc",
    },
    {
      name: "house2",
      description: "house 2 desc",
    },
    {
      name: "house2",
      description: "house 2 desc",
    },{
      name: "house2",
      description: "house 2 desc",
    },{
      name: "house2",
      description: "house 2 desc",
    },{
      name: "house2",
      description: "house 2 desc",
    }
  ]

function House(){
    return ( <div class="wrapper">
    {houses.map((house) => (
      <div class="container">
      <h2 class="title">{house.name}</h2>
      <p class="description">{house.description}</p>
      </div>
    ))}
    </div>)


}
export default House;
